measurements.description:
Twenty-six slightly cupped flowers on two up to 97-cm upright staked inflorescences; 

 sepals ivory overlaid centrally red-pink;
 petals ivory, midline red-pink, suffused near midline;
 lip ivory, midlobe picotee, dark red-pink distally, side lobes edged pink, callus yellow; 
 column ivory overlaid and spotted dark pink, anther cap white;

 substance firm; texture matte.
